// Navbar.js

import React, { useState } from 'react';
import { useNavigate, Routes, Route } from 'react-router-dom';
import navLogo from '../../navLogo.jpg';
import './navbar.css';

// Lazy-loaded components
const AssetEntryInfoForm = React.lazy(() => import('../assetEntryInfo/assetEntryInfo.js'));
const AssetRegistrationForm = React.lazy(() => import('../assetRegistration/assetRegistration.js'));
const AssetDeviceMappingForm = React.lazy(() => import('../assetDeviceMapping/assetDeviceMapping.js'));
const AssetDriverMapping = React.lazy(() => import('../assetDriverMapping/assetDriverMapping.js'));
const DeviceEntryForm = React.lazy(() => import('../deviceEntry/deviceEntry.js'));
const DriverRegistrationForm = React.lazy(() => import('../driverRegistration/driverRegistration.js'));
const EntityCreationForm = React.lazy(() => import('../entityCreation/entityCreation.js'));
const TransporterCreationForm = React.lazy(() => import('../transporterCreation/transporterCreation.js'));
const PortDeviceMappingForm = React.lazy(() => import('../portDeviceMapping/portDeviceMapping.js'));
const ServiceDataLogForm = React.lazy(() => import('../serviceDataLog/serviceDataLog.js'));

const Navbar = () => {
  const navigate = useNavigate();
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleFormClick = (path) => {
    console.log("path")
    navigate(path);
    setIsDropdownOpen(false); // Close dropdown after clicking an option
  };

  const openDropdown = () => {
    setIsDropdownOpen(true);
  };

  const closeDropdown = () => {
    setIsDropdownOpen(false);
  };

  return (
    <div className='navbar-main'>
      <div className='logo-container'>
        <img src={navLogo} alt='Logo' className='logo' />
        <div className='brand-text'>
          <span>NavitronicX</span>
        </div>
      </div>
      <div className='menu-container' onMouseEnter={openDropdown} onMouseLeave={closeDropdown}>
        <button className='menu-button'>Menu</button>
        {isDropdownOpen && (
          <div className='dropdown-content'>
            <Routes>
              <Route path="/entityCreation" element={<EntityCreationForm />} />
              <Route path="/transporterCreation" element={<TransporterCreationForm />} />
              <Route path="/assetEntryInfo" element={<AssetEntryInfoForm />} />
              <Route path="/assetRegistration" element={<AssetRegistrationForm />} />
              <Route path="/assetDeviceMapping" element={<AssetDeviceMappingForm />} />
              <Route path="/deviceEntry" element={<DeviceEntryForm />} />
              <Route path="/driverRegistration" element={<DriverRegistrationForm />} />
              <Route path="/assetDriverMapping" element={<AssetDriverMapping />} />
              <Route path="/portDeviceMapping" element={<PortDeviceMappingForm />} />
              <Route path="/serviceDataLogForm" element={<ServiceDataLogForm />} />
            </Routes>
          </div>
        )}
        {/* Menu options */}
        {isDropdownOpen && (
          <div className='menu-options'>
            <button onClick={() => handleFormClick('entityCreation')}>
              Entity Registration
            </button>
            <button onClick={() => handleFormClick('transporterCreation')}>
              Transporter Registration
            </button>
            <button onClick={() => handleFormClick('assetEntryInfo')}>
              Asset Info Entry
            </button>
            <button onClick={() => handleFormClick('assetRegistration')}>
              Asset Registration
            </button>
            <button onClick={() => handleFormClick('assetDeviceMapping')}>
              Asset Device Mapping
            </button>
            <button onClick={() => handleFormClick('assetDriverMapping')}>
              Asset Driver Mapping
            </button>
            <button onClick={() => handleFormClick('deviceEntry')}>
              Device Entry
            </button>
            <button onClick={() => handleFormClick('driverRegistration')}>
              Driver Registration
            </button>
            <button onClick={() => handleFormClick('portDeviceMapping')}>
              Port Device Mapping
            </button>
            <button onClick={() => handleFormClick('serviceDataLog')}>
              Service Data Log
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default Navbar;
